// /src/component/Viewer.js
import React from 'react';
import './Viewer.css';
import TypewriterText from '../fx/TypewriterText';
import { useViewerState } from '../states/viewer_state'; // Import the custom hook to access viewer state
import IntroView from './view_content/introView';
import AlphaView from './view_content/alphaView';
import BetaView from './view_content/betaView';


const Viewer = () => {
    const { viewerState } = useViewerState(); // Get the viewer state using the custom hook

    // Render content based on viewer state
    let content;
    switch (viewerState) {
        case 'none':
            content = <TypewriterText>            <div className="page-section">
            <img src="https://avatars.githubusercontent.com/u/151031767?s=200&v=4"></img>
            <p><TypewriterText speed={10}>"prompt": "skynet terminator skull metal slug pixel art neon colors",</TypewriterText></p>
            <p><TypewriterText speed={10}>"model": "prompthero/openjourney",</TypewriterText></p>
            <p><TypewriterText speed={10}>"step": 28,</TypewriterText></p>
            <p><TypewriterText speed={10}>"width": 1024,</TypewriterText></p>
            <p><TypewriterText speed={10}>"height": 1024,</TypewriterText></p>
            <p><TypewriterText speed={10}>"seed": "3308458328"</TypewriterText></p>
        </div> </TypewriterText>;
            break;
        case 'intro':
            content = <IntroView/>;
            break;
        case 'alpha':
            content = <AlphaView/>;
            break;
        case 'beta':
            content = <BetaView/>;
            break;
        default:
            content = <TypewriterText>...waiting for selection.</TypewriterText>;
    }

    return (
        <div className="viewer">
            {content}
        </div>
    );
};

export default Viewer;
